import React, { Component } from "react";


class Header extends Component {

    constructor(props) {
        super(props)
        this.state = { date: new Date() };
        setInterval(() => this.tick(), 1000)
    }

    tick() {
        this.setState({ date: new Date() });
    }

    render() {


        return (
            <div className="container-fluid">
                <div className="row">
                    <div className="col-md-8 text-left">
                        <h1 className="text-success">
                            <img  src="C:\Users\User\Desktop\program\toturial\Olan\React\workshop\server\static\images\logo\logo.png" alt="" />{""}
                             เฮลตี้คาเฟ่ {""}</h1>
                    </div>
                    <div className="col-md-4 text-right">
                        <h5 className="text-muted mt-4">{this.state.date.toLocaleTimeString()}</h5>
                        <ul className="list-inline">
                            <li className="list-inline-item title">หน้าหลัก</li>
                            <li className="list-inline-item title">|</li>
                            <li className="list-inline-item title">เกี่ยวกับเรา</li>
                        </ul>

                    </div>
                </div>
                <hr />

            </div>
        )
    }

}

export default Header;
